const apiKey = 'tq8YcEeIenjrdWAbsjMJPSand9mNbgOF'

const peticionHttp=fetch(`https://api.giphy.com/v1/gifs/random?api_key=${apiKey}`);

peticionHttp
.then(resp => resp.json() )
.then(({data})=>{
  console.log(data.images.original.url)
})
.catch(console.warn);
